import React from 'react'
import {ProductImg} from './style'
import { Swiper, SwiperSlide } from 'swiper/react';


const Slider = () => {
    return (
      <Swiper
      slidesPerView={1}
    >
      <SwiperSlide><ProductImg src='/SLIDER_2500x.jpg' /></SwiperSlide>
      

    </Swiper>
    )
}

export default Slider
